import unittest
from typing import List, Tuple

class Solution:
    def groupAnagrams(self, strs: List[str]) -> List[List[str]]:
        if not strs: return []
        n = len(strs)
        d = {}
        for s in strs:
            d[s] = d.get(s, 0) + 1
        ans = [[[]]] * n
        for i in range(n):
            for j in range(n):
                if d[strs[i]] == d[strs[j]]:
                    ans[i].append(strs[j])
        return ans

